/**
 * this the public requests for Client and Seller (CS)
 */

const productsCS = {};
productsCS.categories = [];
productsCS.saleRoute = "";
productsCS.testProductBasic = {
    "id": "Flores_casa_do_carnaval",
    "name": "Flores casa do carnaval",
    "price": 80.85,
    "category": "Carnaval",
    "description": "LindÃ­ssimas flores que tornaram o seu carnaval mais bonito"
};
productsCS.testPhotoBasic = {
    img64: ``
};

productsCS.init = (app, dbManager) =>{
    
    productsCS.saleRoute = process.env.PRODUCTS_ROUTE + process.env.SALE_ROUTE;
    productsCS.storeInMemoryData(dbManager);

    productsCS.buildRequests(app, dbManager);
}

productsCS.storeInMemoryData = async (dbManager) => {
    const executeInner = async () => {
        return new Promise((resolve)=>{
            setTimeout(async () => {
                console.log("Gather products in memory info...");
                productsCS.categories = await dbManager.readFilesPath(productsCS.saleRoute);
                productsCS.categories = productsCS.categories.files || [];
                resolve();
            }, 5);
        });
    };

    await executeInner();

    if(!process.isSeller){
        console.log("watch");
        dbManager.watchFile(productsCS.saleRoute, executeInner);
    }

     
}

productsCS.createNewCategory = (category, dbManager) =>{
    dbManager.createFolder(productsCS.saleRoute, category);
    productsCS.storeInMemoryData(dbManager);
} 

productsCS.getCategories = () =>{
    return productsCS.categories;
}

productsCS.buildRequests = (app, dbManager) =>{

    app.get('/products/categories', (req, res)=> {
        res.send({categories: productsCS.categories});
    });

    /**
     {
           "category": "Cat1"
     }
     */
    app.post('/products/bycategory', async (req, res)=> {
        const result = JSON.parse(req.body || {category: ""});
        let category = result.category || "";
        category = category.replaceAll(".", "").replaceAll("/", "").replaceAll("\\", "");

        const path = productsCS.saleRoute + category;

        console.log('/products/bycategory', result);
        
        if(category != "" && dbManager.checkIfFolder(path)){
             
               let products = [];
               const allFiles = await dbManager.readFilesPath(path);

               for(let file of allFiles.files){
                   if(!file.includes("_Photo")){
                        const product = await dbManager.readFile(path + "/", file, true);
                        products.push( product );
                   }
               }

                res.send({products});
                
        }else{
            res.send({error: "Category does not exist!"});
        }
    });


    /**
      {
           "id": "product1"
           "category": "Cat1"
           "isOutOfSale": true
      }
      
     */
    app.post('/products/photo', async (req, res)=> {
        const result = JSON.parse(req.body || {id: "", category: ""});
        let category = result.category || "";
        category = category.replaceAll(".", "").replaceAll("/", "").replaceAll("\\", "");

        let product = result.id || "";
        category = category.replaceAll(".", "").replaceAll("/", "").replaceAll("\\", "");

        const path = result.isOutOfSale ? process.env.PRODUCTS_ROUTE + process.env.OUT_OF_SALE_ROUTE + "/" + category : (productsCS.saleRoute + category);

        console.log('/products/photo', result);

        if(category != "" && dbManager.checkIfFolder(path) && product != ""){
            try {
                console.log(path + "/" + product + "_Photo.json");
                const productPhoto = await dbManager.readFile(path + "/" , product + "_Photo.json", true);

                res.send({productPhoto});
            }catch(err){
                console.log(err);
                res.send({error: "Error getting file!"});
            }
            
        }else{
            res.send({error: "File path problem!"});
        }
    });

    /**
      {
      }
     */
    app.get('/products/UI', async (req, res)=> {
        
        if(dbManager.checkIfFileExists(process.env.TEST_FILE)){
            try {
                const product = await dbManager.readFile('', process.env.TEST_FILE, true);

                res.send(product);
            }catch(err){
                console.log("error:" + err);
                res.send({error: "Error getting file!"});
            }
        }else{
            dbManager.writeFile('', process.env.TEST_FILE, productsCS.testProductBasic);
            res.send(productsCS.testProductBasic);
        }
    });

    /**
      {
      }
     */
    app.get('/products/UI/photo', async (req, res)=> {

        if(dbManager.checkIfFileExists(process.env.TEST_PHOTO_FILE)){
            try {
                console.log(process.env.TEST_PHOTO_FILE);
                const productPhoto = await dbManager.readFile('',process.env.TEST_PHOTO_FILE, true);

                res.send({productPhoto});
            }catch(err){
                console.log(err);
                res.send({error: "Error getting file!"});
            }
        }else{
            dbManager.writeFile('', process.env.TEST_PHOTO_FILE, productsCS.testPhotoBasic);
            res.send({productPhoto: productsCS.testPhotoBasic});
        }
    });

}



export default productsCS;